import React from "react";
import { storiesOf } from "@storybook/react";
import Transition from "./index";

const DefaultTransition = () => {
  return (
    <>
      <Transition
        animation="zoom-in-left"
        wrapper={true}
        classNames="flex"
      ></Transition>
    </>
  );
};

storiesOf("Transition", module).add("Transition", DefaultTransition);
